import Filters from './filters'
import '../../Styles/Inventory.css';
import InventoryTable from './InventoryTable';

const inventoryItems = [
  { id: 1, name: "Premium Coffee Beans", variant: "Arabica", sku: "PC-1001", category: "Beverages", stock: 124, price: 330 },
  { id: 2, name: "Organic Tea Leaves", variant: "Green Tea", sku: "OT-2005", category: "Beverages", stock: 87, price: 460 },
  { id: 3, name: "Glass Bottles 500ml", variant: "Clear", sku: "GB-3002", category: "Packaging", stock: 342, price: 90},
  { id: 4, name: "Paper Cups 12oz", variant: "White", sku: "PC-4003", category: "Packaging", stock: 156, price: 120 },
];

export default function Inventory() {
  return (
    <div className="inventory-container">
      <div className="inventory-header">
        <h2>Inventory Management</h2>
        <button className="add-btn">+ Add New Item</button>
      </div>
    <Filters/>
    <InventoryTable/>
      </div>
  );
}
